      "Description_en": "An anemone that makes its home at the foot of the cliff where Saint Fathric performed his ablutionary rites. Its mane of blond tendrils resembles the hair of the short-tempered penitent, who was prone to fly into a furious rage when disturbed.",
      "Description_fr": "Une variété d'anémone de mer qui vit en bas de la falaise du temple de Saint-Fathric. D'aucuns la comparent à la chevelure d'un ancien sage, qui avait tendance à s'ébouriffer durant ses accès de colère.",
