      "Description_de": "Wie der Name bereits verrät, ist dieser Fisch dem sagenumwobenen Kelpie zum Verwechseln ähnlich. Einst tarnte es sich zwischen dunklen, braunen Algen, aber nachdem die Feen Il Mheg übernommen haben und es mit Blumen füllten, passten sich seine Schuppen der farbenfrohen Pracht an.",
