      "Description_de": "Ein köstlicher, aber kein sehr hübsch anzusehender Süßwasserfisch, der in vielen Gerichten der traditionellen Küche von Voeburt auftaucht. Um seinem eigenartigen Geruch Herr zu werden, wurde er grundsätzlich mit reichlich Kräutern serviert.",
