      "Description_de": "Die Notiz eines neugierigen Forschers, der von den Pilzen auf dem Panzer der Krabbe kostete:\n\nIch wohn' in einem Pilzelein, der wächst in meinem Gärtelein und ist mein buntes Heimelein. Jetzt sitz' ich hier, ganz allein, und mir brennt das kleine Köpfelein!",
